import React from "react";
import { ReactComponent as Phone } from "../images/phone.svg";
import { ReactComponent as Mail } from "../images/mail.svg";
import { ReactComponent as Home } from "../images/home.svg";
import { ReactComponent as Linkedin } from "../images/linkedin.svg";

const Contact = ({ contact }) => {
  return (
    <li className="contact-container">

      <Phone className="phone"/><p className="contact-information">{contact.phone}</p>
      <Mail className="mail"/><p className="contact-information">{contact.email}</p>
      <Home className="home"/><p className="contact-information">{contact.website}</p>
      <Linkedin className="linkedin"/><p className="contact-information">{contact.linkedin}</p>

    </li>
  );
};

export default Contact;
